Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").toJavaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").toJavaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Long)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val topQueriesArray = broadcastTopQueries.value
      val currentTime = System.currentTimeMillis()
      val hitMiss = new ListBuffer[(String, Boolean)]()

      iter.foreach { line =>
        val Array(query, timestamp) = line.split(" ")
        val timestampLong = timestamp.toLong

        if (topQueriesArray.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestampLong, timestampLong))
          val (lastAccessTime, lastUpdateTime) = cacheEntry

          if (timestampLong - lastAccessTime > 12 * 60 * 60 * 1000) {
            // Cache miss, update cache and send request to retrieve query
            cache.put(query, (timestampLong, timestampLong))
            hitMiss.append((query, false))
          } else {
            // Cache hit
            hitMiss.append((query, true))
          }
        }
      }

      hitMiss.iterator
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateDouble = hitRate._2.toDouble / (hitRate._1 + hitRate._2)

    println(s"Hit rate: $hitRateDouble")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the queries and their last access and update times. It processes the onsite data by iterating over each line and checking if the query is in the top frequent queries. If it is, the job checks if the query is in the cache and if it has been accessed within the last 12 hours. If it has not been accessed within the last 12 hours, the job updates the cache and sends a request to retrieve the query. If it has been accessed within the last 12 hours, the job marks it as a cache hit.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries processed.

