Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
Static variables are variables that retain their value between function calls. They are declared using the keyword "static" and are initialized only once. They have a default value of zero if not explicitly initialized. Static variables are stored in the data segment of the program's memory.

Here is an example of a static variable:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
