In this code, I've added a `debounceTimeout` ref that will store the ID of the setTimeout function. Before setting a new timeout, we check if there's an existing one and clear it if there is. This ensures that the code inside the timeout will only run once every 0.6 seconds.

Also, I've added a cleanup function to the useEffect hook to clear the timeout when the component unmounts. This is to prevent memory leaks.

