Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const bufferSize = Math.ceil(entities.length * 1 / 8) * 8; // Ensure the buffer size is a multiple of 8
  const buffer = new ArrayBuffer(bufferSize);
  const view = new DataView(buffer);

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const offset = i * 1; // No padding between entities

    // Pack id (4 bits)
    view.setUint8(offset, (view.getUint8(offset) & 0xF0) | (entity.id & 0x0F));

    // Pack size (3 bits)
    view.setUint8(offset, (view.getUint8(offset) & 0x0F) | ((entity.size & 0x07) << 4));
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < view.byteLength; i++) {
    const offset = i * 1; // No padding between entities
    const packedEntity = view.getUint8(offset);

    // Unpack id (4 bits)
    const id = packedEntity & 0x0F;

    // Unpack size (3 bits)
    const size = (packedEntity >> 4) & 0x07;

    entities.push({ id, size });
  }

  return entities;
}
```

These functions assume that the `entities` array is an array of objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size that is a multiple of 8, and then iterates through the entities, packing their `id` and `size` into the ArrayBuffer using bitwise operations. The `unpackEntities` function does the reverse, iterating through the ArrayBuffer and extracting the `id` and `size` from each packed entity.

